using UnityEngine;
using UnityEngine.Events;
using UnityEngine.InputSystem;

[CreateAssetMenu(fileName = "PlayerInpurController")]
public class PlayerInputController : ScriptableObject, PlayerInputAction.IGamePlayActions, PlayerInputAction.IUIActions
{
    // 
    public event UnityAction<Vector2> onMovement; // 
    public event UnityAction<bool> onFire; // 
    public event UnityAction onDodge; // 
    public event UnityAction<bool> onCrouch; //  - 
    public event UnityAction onReload; // 
    public event UnityAction onPickup; // 
    public event UnityAction<bool> onRun; // 
    public event UnityAction onOperate; // 
    public event UnityAction onWeaponInspection; // 
    public event UnityAction onBackPack; // 
    
    // 
    PlayerInputAction playerinputAction;

    // 
    private void OnEnable()
    {
        playerinputAction = new PlayerInputAction(); // 
        // 
        playerinputAction.GamePlay.SetCallbacks(this);
        playerinputAction.UI.SetCallbacks(this); // 
    }

    public void EnabledGameplayInput()
    {
        playerinputAction.GamePlay.Enable(); // 
    }
    
    public void EnabledUIInput()
    {
        playerinputAction.UI.Enable(); // 
    }
    
    // 
    public void DisableGameplayInput()
    {
        playerinputAction.GamePlay.Disable(); // 
    }
    
    public void DisableUIInput()
    {
        playerinputAction.UI.Disable(); // 
    }

    // 
    public void OnMove(InputAction.CallbackContext context) // 
    {
        if (context.performed) // 
        {
            onMovement?.Invoke(context.ReadValue<Vector2>());
        }
        else if (context.canceled) // 
        {
            onMovement?.Invoke(Vector2.zero); // 
        }
    }

    public void OnFire(InputAction.CallbackContext context)
    {
        bool isPressed = context.started || context.performed;
        onFire?.Invoke(isPressed);
    }
    
    public void OnPickUp(InputAction.CallbackContext context) // 171177117117771171177117117777117117711711777117117711711777770171177117117771171177117117777117117711711777117117711711777771171177117117771171177117117777117117711711777117117711711777770171177117117771171177117117777117117711711777117117711711777770
    {
        if (context.started) // 
        {
            onPickup?.Invoke();
        }
    }
    public void OnDodge(InputAction.CallbackContext context) // 
    {
        if (context.started) // 
        {
            onDodge?.Invoke();
        }
    }
    public void OnReload(InputAction.CallbackContext context) // 
    {
        if (context.started) // 
        {
            onReload?.Invoke();
        }
    }

    public void OnRun(InputAction.CallbackContext context) // 
    {
        if (context.started) // 
        {
            onRun?.Invoke(true); // 
        }
        else if (context.canceled) // 
        {
            onRun?.Invoke(false); // 
        }
    }
    public void OnCrouch(InputAction.CallbackContext context) // 
    {
        if (context.started) // 
        {
            onCrouch?.Invoke(true); // 
        }
        else if (context.canceled) // 
        {
            onCrouch?.Invoke(false); // 
        }
    }

