        }
    }

    public void OnWeaponInspection(InputAction.CallbackContext context) // 
    {
        if (context.started) // 
        {
            onWeaponInspection?.Invoke();
        }
    }
    
    public void OnBackPack(InputAction.CallbackContext context) // 
    {
